#[derive(PartialEq,Eq)]
struct G2Precomp {
    q: Affine<G2Params>,
    coeffs: Vec<ell_coeffs>
}

impl G2Precomp {
    fn new(from: &G2) -> G2Precomp {
        let g2 = from.to_affine();

        let mut r = g2.to_jacobian();

        let mut result = G2Precomp {
            q: g2.clone(),
            coeffs: Vec::new()
        };

        let two_inv = Fq::from("2").inverse();

        let mut found_one = false;
        let ate = ate_loop_count();
        for i in (0..FrParams::bits()).rev() {
            let bit = ate.test_bit(i);

            if !found_one {
                found_one = bit;
                continue;
            }

            result.coeffs.push(r.doubling_step_for_flipped_miller_loop(&two_inv));

            if bit {
                result.coeffs.push(r.mixed_addition_step_for_flipped_miller_loop(&g2));
            }
        }

        let q1 = g2.mul_by_q();
        let q2 = q1.mul_by_q().neg();

        result.coeffs.push(r.mixed_addition_step_for_flipped_miller_loop(&q1));
        result.coeffs.push(r.mixed_addition_step_for_flipped_miller_loop(&q2));

        result
    }
}

