pub fn final_exponentiation_first_chunk(elt: &Fq12) -> Fq12 {
    let a = elt.unitary_inverse();
    let b = elt.inverse();
    let c = a * b;
    let d = c.frobenius_map(2);

    d * c
}

pub fn exp_by_neg_z(elt: &Fq12) -> Fq12 {
    elt.cyclotomic_exp(&final_exponent_z()).unitary_inverse()
}

