pub fn final_exponentiation_last_chunk(elt: &Fq12) -> Fq12 {
    let a = exp_by_neg_z(elt);
    let b = a.cyclotomic_squared();
    let c = b.cyclotomic_squared();
    let d = c.mul(&b);

    let e = exp_by_neg_z(&d);
    let f = e.cyclotomic_squared();
    let g = exp_by_neg_z(&f);
    let h = d.unitary_inverse();
    let i = g.unitary_inverse();

    let j = i.mul(&e);
    let k = j.mul(&h);
    let l = k.mul(&b);
    let m = k.mul(&e);
    let n = m.mul(elt);

    let o = l.frobenius_map(1);
    let p = o.mul(&n);

    let q = k.frobenius_map(2);
    let r = q.mul(&p);

    let s = elt.unitary_inverse();
    let t = s.mul(&l);
    let u = t.frobenius_map(3);
    let v = u.mul(&r);

    v
}

pub fn final_exponentiation(elt: &Fq12) -> Fq12 {
    final_exponentiation_last_chunk(&final_exponentiation_first_chunk(elt))
}

pub fn pairing(p: &G1, q: &G2) -> Gt {
    let p = p.to_affine();
    let q = G2Precomp::new(q);

    Gt::new(final_exponentiation(&miller_loop(&p, &q)))
}

